import React from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css'; // Asegúrate de tener este archivo CSS para los estilos
import { Container, Row, Col, Navbar, Nav } from 'react-bootstrap';

const Dashboard = ({ children }) => {
    const user = JSON.parse(localStorage.getItem('user'));

    return (
        <Container fluid className="dashboard-container">
            <Row>
                <Col md={2} className="sidebar">
                    <Navbar bg="dark" variant="dark" expand="md" className="flex-column">
                        <Navbar.Brand href="#home">
                            <img
                                src="tu-logo.png"
                                height="30"
                                className="d-inline-block align-top"
                                alt="Logo"
                            />
                        </Navbar.Brand>
                        <Nav className="flex-column">
                            {user.escritorio && <Nav.Link as={Link} to="/escritorio">Escritorio</Nav.Link>}
                            {user.pacientes && <Nav.Link as={Link} to="/pacientes">Pacientes</Nav.Link>}
                            {user.clinica && (
                                <>
                                    <Nav.Link as={Link} to="/clinica">Clínica</Nav.Link>
                                    <Nav className="ml-3 flex-column">
                                        <Nav.Link as={Link} to="/configuracion">Configuraciones</Nav.Link>
                                        <Nav.Link as={Link} to="/servicio">Servicios</Nav.Link>
                                        <Nav.Link as={Link} to="/personal">Personal</Nav.Link>
                                        <Nav.Link as={Link} to="/permiso">Permisos</Nav.Link>
                                        <Nav.Link as={Link} to="/diagnostico">Diagnóstico</Nav.Link>
                                    </Nav>
                                </>
                            )}
                            {user.atencion && <Nav.Link as={Link} to="/atencion">Atención</Nav.Link>}
                            {user.triaje && <Nav.Link as={Link} to="/triaje">Triaje</Nav.Link>}
                            {user.resultado && <Nav.Link as={Link} to="/plan">Plan de Atención</Nav.Link>}
                            {user.consultas && (
                                <>
                                    <Nav.Link as={Link} to="/consultas">Consultas</Nav.Link>
                                    <Nav className="ml-3 flex-column">
                                        <Nav.Link as={Link} to="/pagos">Pagos</Nav.Link>
                                        <Nav.Link as={Link} to="/historias">Historias</Nav.Link>
                                    </Nav>
                                </>
                            )}
                        </Nav>
                        <button onClick={() => {
                            localStorage.clear();
                            window.location.href = '/login';
                        }} className="btn btn-danger mt-3">Logout</button>
                    </Navbar>
                </Col>
                <Col md={10} className="main-content">
                    <header>
                        <h1>Welcome, {user.nombre}</h1>
                    </header>
                    <main>
                        {children}
                    </main>
                </Col>
            </Row>
        </Container>
    );
};

export default Dashboard;
